/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Axios from 'axios';

// Logout feature
import { logout } from '../../components/logout';

// Import API functions
import { handleSubmitNewRso } from '../API/rso/handleSubmitNewRso';
import { handleJoinRso } from '../API/rso/handleJoin';
import { handleLeaveRso } from '../API/rso/handleLeaveRso'

// Import JSX
import RsoPage from './mainRso';

function MainRso()
{
    // Used to navigate around the web app
    const navigate = useNavigate();

    const uniId = sessionStorage.getItem('universityId')
    const userId = sessionStorage.getItem('id')

    return (
        <div>
            <RsoPage
                rsoList={rsoList}
                // rsoName={rsoName}
                // setRsoName={setRsoName}
                navigate={navigate}
                handleJoinRso={handleJoinRso}
                handleLeaveRso={handleLeaveRso}
                handleSubmitNewRso={handleSubmitNewRso}
                logout={logout}
                uniId={uniId}
                userId={userId}
            />
        </div>
    )
}

export default MainRso;
